description: 'Gas-rich galaxies display a wide range of structures and properties,
  but one thing they all seem to have are some newly formed stars. Images from the
  Survey for Ionization in Neutral Gas Galaxies (SINGG), an NOAO Survey Program (obtained
  with the CTIO 1.5m telescope), are designed to highlight areas of star formation
  in gas rich galaxies. This image shows a strong interaction between the barred spiral
  NGC1512 and its Blue Compact Dwarf (BCD) companion, NGC1510. Star formation in NGC1512
  is concentrated into two rings; the inner one has the strength of a starburst. Surprisingly
  star formation is even stronger in the BCD NGC1510, which can be seen to the lower
  right of NGC1512. This pair ilustrate how galaxy interactions are able to trigger
  starbursts. The image is displayed so that stars have a cyan-blue appearance, while
  ionized hydrogen (H-alpha) emission appears orange-red to yellow. The H-alpha emission
  marks where the gas in the galaxies has been stripped of electrons, and is now recombining.
  It takes very hot O stars to ionize the gas; these stars have very short lifetimes
  (a few million years). As a result, red tones in these images typically mark the
  location of newly formed hot stars. Gerhardt Meurer of The Johns Hopkins University,
  Baltimore, MD, is the principal investigator for SINGG. For more information, see:
  http://sungg.pha.jhu.edu/'
foreground_image_set_url: http://data1.wwtassets.org/feeds/noirlab/noao-j0403-43_crop1/L{1}X{2}Y{3}.png
name: NGC 1512/10, SINGG Survey
