description: This image was obtained with the wide-field view of the Mosaic camera
  on the Mayall 4-meter telescope at Kitt Peak National Observatory. LBN 777 is a
  portion of the large cloud of dust and gas known as the Taurus Molecular Cloud.
  The brownish color is caused by large dust grains embedded in the gas. The dust
  reflects the light of the stars inside and near the nebula. The image was generated
  with observations in B (blue), V (green) and I (red) filters. In this image, North
  is down, East is to the right.
